import React, { useState } from "react";
import csvData from "./bestPitches_ex.csv";

export const Results = () => {
  const [playerData, setPlayerData] = useState([]);
  const [searchTerm, setSearchTerm] = useState("");
  const [stuffGrade, setStuffGrade] = useState("");

  const handleSearch = () => {
    const foundPlayer = playerData.find(
      (data) => data.player_name.toLowerCase() === searchTerm.toLowerCase()
    );
    if (foundPlayer) {
      setStuffGrade(foundPlayer.stuffGrade);
    } else {
      setStuffGrade("Player not found");
    }
  };

  const handleInputChange = (e) => {
    setSearchTerm(e.target.value);
  };

  const handleKeyPress = (e) => {
    if (e.key === "Enter") {
      handleSearch();
    }
  };

  const handleButtonClick = () => {
    handleSearch();
  };

  const handleClear = () => {
    setSearchTerm("");
    setStuffGrade("");
  };

  const handleTableHeader = () => {
    return (
      <thead>
        <tr>
          <th>Player Name</th>
          <th>Pitch Type</th>
          <th>Stuff Grade</th>
          <th>Release Speed</th>
          <th>InducedVertBreak</th>
        </tr>
      </thead>
    );
  };

  const handleTableBody = () => {
    return (
      <tbody>
        {playerData
          .filter((data) =>
            data.player_name.toLowerCase().includes(searchTerm.toLowerCase())
          )
          .map((data, index) => (
            <tr key={index}>
              <td>{data.player_name}</td>
              <td>{data.pitch_type}</td>
              <td>{data.stuffGrade}</td>
              <td>{data.release_speed}</td>
              <td>{data.InducedVertBreak}</td>
            </tr>
          ))}
      </tbody>
    );
  };

  const handlePlayerStats = () => {
    return (
      <div>
        {stuffGrade ? `Stuff Grade: ${stuffGrade}` : null}
      </div>
    );
  };

  const handleClearButton = () => {
    return (
      <button onClick={handleClear}>Clear</button>
    );
  };

  return (
    <div>
      <input
        type="text"
        value={searchTerm}
        onChange={handleInputChange}
        onKeyPress={handleKeyPress}
        placeholder="Enter player name"
      />
      <button onClick={handleButtonClick}>Search</button>
      {handleTableHeader()}
      {handleTableBody()}
      {handlePlayerStats()}
      {handleClearButton()}
    </div>
  );
};
